import styled from "styled-components"
import { Title, Content } from "../components/modules"

const FifthPage = () => {
  const items = [
    {
      name: "성장시키기",
      img: "images/feed.png",
      description:
        "Commit과 Push를 했다면 밥주기 버튼을 눌러 모티에게 밥을 먹일 수 있어요. 커밋 1회 당 상점에서 사용할 수 있는 코인도 얻을 수 있어요.(일일 최대 3개)",
      color: "#C3F6C0",
    },
    {
      name: "애정도",
      img: "images/love.png",
      description:
        "모티와의 상호작용을 통해 애정도를 높일 수 있어요.(일일 최대 5%) 애정도가 높다면 색다른 모습의 모티를 볼 수 있을거에요.",
      color: "#FFAAAA",
    },
    {
      name: "상점",
      img: "images/cart.png",
      description:
        "차곡차곡 모은 코인은 상점에서 사용 가능해요. 모티를 키우는데 활용할 수 있는 다양한 아이템을 만나보세요!",
      color: "#FFE8A5",
    },
    {
      name: "아이템",
      img: "images/gift.png",
      description:
        "다양한 아이템을 활용하여 모티를 키울 수 있어요. 적절한 아이템 사용은 모티의 성장에 도움을 줄 거에요.",
      color: "#A1C5FF",
    },
    {
      name: "랭킹",
      img: "images/shield.png",
      description:
        "다른 사람들이 모티를 얼마나 오랫동안 잘 키우고 있는지 볼 수 있어요. 키운 기간과 애정도에 따라 순위가 매겨져요.",
      color: "#f7cb9a",
    },
    {
      name: "커스터마이즈",
      img: "images/color-circle.png",
      description:
        "앱 색상을 커스터마이징할 수 있어요. 이렇게 커스터마이징한 색상은 다른 PC에서 로그인해도 변하지 않아요.",
      color: "#e1e3e1",
    },
  ]

  return (
    <Background id="5">
      <Title>이런 기능들이 있어요</Title>
      <Grid>
        {items.map((item, i) => (
          <Card key={item.name}>
            <Image color={item.color}>
              <Icon src={item.img} alt="image"></Icon>
            </Image>
            <Name>{item.name}</Name>
            <Description>{item.description}</Description>
          </Card>
        ))}
      </Grid>
    </Background>
  )
}

export default FifthPage

const Background = styled.div`
  height: 200vh;
  width: 70vw;
  margin-left: 15vw;
  background: white;
  display: flex;
  flex-direction: column;
  justify-content: center;
`

const Grid = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  margin-top: 3rem;
`

const Card = styled.div`
  display: flex;
  flex-direction: column;
  width: 20vw;
  margin: 2rem 0;
`

const Image = styled.div<{ color: string }>`
  background: ${(props) => props.color};
  width: 8vw;
  height: 8vw;
  border-radius: 30px;
  display: flex;
  justify-content: center;
  align-items: center;
`

const Icon = styled.img`
  width: 60%;
  height: 60%;
`

const Name = styled.div`
  font-size: 25px;
  margin: 2rem 0 1rem 0;
`

const Description = styled.div`
  font-size: 20px;
  color: grey;
  line-height: 2rem;
`
